css:
@-moz-document domain("www.youtube.com"){

html:not(.style-scope)[dark], :not(.style-scope)[dark] {
    --yt-spec-brand-background-solid: #222635;
    --yt-spec-brand-background-primary: rgba(34, 38, 53,0.8);
    --yt-spec-brand-background-secondary: rgba(33, 33, 33, 0.95);
    --yt-spec-general-background-a: #1E212F;
    --yt-spec-general-background-b: #222635;
    --yt-spec-general-background-c: #222635;
    
    --ytd-searchbox-background: rgba(255, 255, 255, 0.1);
	--ytd-searchbox-legacy-border-color:  rgba(255, 255, 255, 0.1);
}


#masthead-container.ytd-app,
#chips-wrapper{
	backdrop-filter: blur(12px);
}

/* Sarch */
#search-icon-legacy.ytd-searchbox,
#search-icon-legacy.ytd-searchbox:hover{
    background: none;
    border: none;
    margin-left: -59px;
}

#container.ytd-searchbox{
	border-radius: 32px;
}

